import React from 'react';
import Nav from './Nav';
import Home from './Home';
import P2 from './Page2';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <div>
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/2">
              <P2 />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
